import React from "react";
import SideIcons from "./SideIcons";


function NavBar() {
    return <header>
        <h1>Ashhab</h1>

        <SideIcons text="About" />
        <SideIcons text="Skills" />
        <SideIcons text="Experience" />
        <SideIcons text="Projects" />
        <SideIcons text="Contact" />
    </header>
}

export default NavBar;
